import React from "react";
import cityGuide from "../images/city-guide-app.png";
import netflix from "../images/netflix.png";
import portfolio from "../images/portfolio.png";
import taskManager from "../images/task-manager.png";

import halza from "../images/halza.jpg";
import halza365 from "../images/halza365.png";
import halzafull from "../images/halzafull.jpg";
import myhalza from "../images/myhalza.png";
import st_home from "../images/st_home.jpeg";
import st_view from "../images/st_view.jpeg";
// FONTAWESOME IMPORTS
import { faSearchPlus } from "@fortawesome/free-solid-svg-icons";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
// REACT POPUPBOX
import { PopupboxContainer, PopupboxManager } from "react-popupbox";
import "react-popupbox/dist/react-popupbox.css";

const Pofrfolio = () => {
  //linkways

  const openPopupboxTaskLinkways = () => {
    const content = (
      <>
        {/* <h1> Halza App </h1> */}
        <img
          className="portfolio-image-popupbox"
          style={{ height: "330px", width: "175px" }}
          src={st_view}
          alt="Stock Taker"
        />
        <br></br>{" "}
        <a
          className="hyper-link"
          // onClick={() =>
          //   window.open(
          //     "https://play.google.com/store/apps/details?id=com.Halza&hl=en_SG"
          //   )
          // }
        >
          {/* https://play.google.com/store/apps/details?id=com.Halza&hl=en_SG */}
        </a>
      </>
    );
    PopupboxManager.open({ content });
  };

  const popupboxConfigTaskLinkwaysHome = {
    titleBar: {
      enable: true,
      // text: "Halza App"
    },
    fadeIn: true,
    fadeInSpeed: 500,
  };

  //halza

  const openPopupboxTaskManagerHalza = () => {
    const content = (
      <>
        {/* <h1> Halza App </h1> */}
        <img
          className="portfolio-image-popupbox"
          style={{ height: "330px", width: "175px" }}
          src={halzafull}
          alt="myHalza pass and PeriodTracker projects..."
        />
        <br></br>{" "}
        <a
          className="hyper-link"
          onClick={() =>
            window.open(
              "https://play.google.com/store/apps/details?id=com.Halza&hl=en_SG"
            )
          }
        >
          https://play.google.com/store/apps/details?id=com.Halza&hl=en_SG
        </a>
      </>
    );
    PopupboxManager.open({ content });
  };

  const popupboxConfigTaskManagerHalza = {
    titleBar: {
      enable: true,
      // text: "Halza App"
    },
    fadeIn: true,
    fadeInSpeed: 500,
  };

  //halza365

  const openPopupboxhalza365 = () => {
    const content = (
      <>
        {/* <h1> myHalza</h1> */}
        <img
          className="portfolio-image-popupbox"
          src={halza365}
          alt="halza365"
        />
        <br></br>{" "}
        <a
          className="hyper-link"
          onClick={() => window.open("https://halza365.com/en")}
        >
          https://halza365.com/en
        </a>
      </>
    );
    PopupboxManager.open({ content });
  };
  const popupboxConfihalza365 = {
    titleBar: {
      enable: true,
      // text: "myHalza"
    },
    fadeIn: true,
    fadeInSpeed: 500,
  };

  const openPopupboxmyHalza = () => {
    const content = (
      <>
        {/* <h1> myHalza</h1> */}
        <img className="portfolio-image-popupbox" src={myhalza} alt="myHalza" />
        <br></br>{" "}
        <a
          className="hyper-link"
          onClick={() => window.open("https://myhalza.com/")}
        >
          https://myhalza.com/{" "}
        </a>
      </>
    );
    PopupboxManager.open({ content });
  };
  const popupboxConfigmyHalza = {
    titleBar: {
      enable: true,
